var imageReport = "data:image/jpg;base64,";
$(function () {
  $(document).on("keypress", "form", function (e) {
    var code = e.keyCode || e.which;
    if (code == 13) {
        e.preventDefault();
        return false;
    }
  });
  $('.select2').select2({
    placeholder:'Seleccione una opcin',
    language: 'es'
  });
  $(document).on('select2:open', () => {
    document.querySelector('.select2-search__field').focus();
  });
  $("input[data-bootstrap-switch]").each(function(){
    $(this).bootstrapSwitch('state', $(this).prop('checked'));
  });
  $("#lists").DataTable({
    "responsive": false,
    "lengthChange": false,
    "autoWidth": false,
    "ordering": false,
    "search": true,
    "buttons": ["excel",
    {
      extend: "pdfHtml5",
      filename: function() {
        return "MyPDF"      
      },
      title: `Osteosntesis \n Reporte de ${$('#titleview').text()}`,
      download: 'open',
      orientation: 'portrait',
      pageSize: 'LETTER',
      customize: function(doc){
        doc.content.splice(1, 0, {
          margin: [10,-80,10,5],
          image: imageReport,
          width: 150
        });
      },
      exportOptions: {
        columns: ':visible:not(:eq(-1))'
      }
    },
    "colvis"]
  }).buttons().container().appendTo('#lists_wrapper .col-md-6:eq(0)');
  $("#list_reports").DataTable({
    "dom": '<"container-fluid"<"row"<"col"B><"col"l><"col"f>>>rtip',
    "responsive": false,
    "lengthChange": false,
    "autoWidth": false,
    "searchable": true,
    "buttons": ["excel",
    {
      extend: "pdfHtml5",
      filename: function() {
        return "MyPDF"      
      },
      title: `SELL POINT \n Reporte de ${$('#titleview').text()}`,
      download: 'open',
      orientation: 'portrait',
      pageSize: 'LETTER',
      customize: function(doc){
        doc.content.splice(1, 0, {
          margin: [10,-80,10,5],
          image: imageReport,
          width: 150
        });
      },
      exportOptions: {
        columns: ':visible:not(:eq(-1))'
      }
    },
    "colvis"]
  });
  
});